import React from "react";
import './Navbar.css'
import avatar from "../../Data/avatar";

function Navbar() {

    function UserInfo() {
        return(
            <div>
                <img src={avatar} id='avatar'></img>
            </div>
        )
    }

    return(
            <nav>
                <div id="site-name">
                    <i className="fa fa-map-pin icon" id="site-name-icon"></i>
                    <h3>Kazoogle</h3>
                </div>
                <div id="user-info">
                    <UserInfo />
                </div>
            </nav>
    )
}

export default Navbar;
